 import React from "react";
 import product_cart from "../data/product_data";
import Box from '@mui/material/Box';
import './mainproduct.css';
import { Button } from "@mui/material";

 const Mainproduct = () => {







const listItem=product_cart.map((item)=>



<Box className="cart"
  style={{
    //color: 'black',
    display: 'flex',
    flexDirection: 'column',
    alignItems: 'center',
    overflow: 'auto',
    overflow: 'auto',
    backgroundColor:'rgba(255,255,255,0.4)',
    boxshadow:"0 8px 32px rgba(31,28,135,0.37)" ,
    backdropfilter:" blur(10px)",
    borderRadius:'10px',
    color:"#ffffff"
  }}
>
<Box  >
<img src={item.thumb} alt="Logo" style={{ height: '100px', margin: '10px', flexGrow: 1 }} />
</Box>

<Box classname="card_header" >
<h2>{item.name}</h2>
<p>{item.description}</p>
<p className="price"><span>{item.real_price}</span></p>
<div className="consult item" ></div>

</Box>
</Box>
    
   
  
 );




return (
  
      <Box className="main_content">
          {listItem}
      </Box>
     
      
  
);
}

 export default  Mainproduct;
